export const home = (req, res) => {

  Video.find({}, (error, videos) => {});
  return res.render("home", {pageTitle: "Home"});
};

export const watch = (req, res) => {
  const { id } = req.params;
  res.render("watch",{ pageTitle: `Watching`});

} 

